(71, 'Matthias Church', 'Official name is \"Church of the Blessed Virgin in Buda\". Central part of church built around 1400, with additions by Turks, and then Baroque-era modifications, finally redone in late 19th Century in neo-Gothic revival. Very much a masterpiece of European eclecticism, though some say it is an over-decorated piece of stage scenery.', 3054643, 'HU', 7, '8730408907.jpg', 'scenery', '2020-07-19 15:50:04', 0),
